import React from 'react';

import '../../normalize.scss';
import '../../base.scss';

import Console from '../../components/Cadastro/Consoles';
import View from "../view/view"

import { useSelector } from 'react-redux';
import Selector from "../../helpers/selector";
import { useHistory } from "react-router-dom";

function CadastroConsole() {
  const history = useHistory();
  const user = useSelector(state => state.user.data); 
  const isLogged = Selector.isLogged(user) ? Selector.isLogged(user) : true ;
  console.log(isLogged)
  console.log("User :: ", user);

  useEffect(() => {
    !isLogged && history.push("/");
    // eslint-disable-next-line
  },[isLogged]);
  return (
    <View cadastro={isLogged}>
        <Console />
    </View>
  )
} 

export default CadastroConsole;
